import React, { Fragment } from "react";

import Header from "./components/Layout/Header";
import AvailableMeals from "./components/Meals/AvailableMeals";

function App() {
  return (
    <Fragment>
      <Header />
      <AvailableMeals />
    </Fragment>
  );
}

export default App;
